import React, { Component } from "react";

class VipIem extends Component {
    render() {
        let item =this.props.item;
        return (
            <div key={item.name} className="col-md-6 border">
                <img src={item.image} className="float-left mr-2 w-25" />
                <h3>{item.name}</h3>
                <div> Mony : {item.worthh}</div>
            </div>

        )
    }
}

export default VipIem;
